import '../../styles.css'
import Logo from "../../Logo.png";
import hh from "../../1.png"
//import 'bootstrap/dist/css/bootstrap.min.css';
import {NavbarBrand,Navbar, Container} from 'reactstrap'
import Card from '../Card'

const App =()=>{
  return (
    <div>
    <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
      nearby Therapist
    </NavbarBrand>
      </Navbar>
      <Container className="bg-light border" >
    <img src={hh} style={{width:"100%"}} />
  </Container>
    <main>
    <Card/>
    </main>
  </div>
    
  );
  }

export default App;
